            accuracy: 20,
            altitude: null,
            altitudeAccuracy: null,
            heading: null,
            latitude: response.latitude,
            longitude: response.longitude,
            speed: null,
        },
        timestamp: Date.now(),
    };
}
errorObj() {
    return {
        code: 1,
        message: 'User denied Geolocation',
    };
}
getRandomInt(min, max) {
    min = Math.ceil(min);
    max = Math.floor(max);
    return Math.floor(Math.random() * (max - min + 1)) + min;
}
